import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

import { Homepage } from "./pages";
import { Navbar } from "./components";

import './App.css';

function App() {
  return (
    <Router>
      <div>
        <Navbar />

        <Switch>
          <Route path="/">
            <Homepage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
